import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import DemoPage from './components/DemoPage'; // Import the DemoPage component
import LoginPage from './components//LoginPage'; // Import the LoginPage component
import MainPage from './MainPage'; // Import the MainPage component
import Navbar from './Navbar'; // Import Navbar (optional)
import Sidebar from './Sidebar'; // Import Sidebar (optional)

const App = () => {
  return (
    <Router>
      <div className="App">
        {/* Optionally add Navbar here */}
        <Navbar />

        {/* Sidebar can be added if you want it to be present on all pages */}
        {/* <Sidebar /> */}

        {/* Main Content */}
        <Routes>
          {/* Route to demo page (landing page) */}
          <Route path="/" element={<DemoPage />} />

          {/* Route to login page */}
          <Route path="/login" element={<LoginPage />} />

          {/* Route to the main page after successful login */}
          <Route path="/main" element={<MainPage />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
